@maudyayunda officially became the first UNIQLO Brand Advocate in Indonesia at the launch of the latest UNIQLO Spring/Summer 2024 collection on Thursday, 18 January, at the Main Atrium Senayan City. With the theme “Ease into Lightness,” UNIQLO presents clothes that are lighter in material, more comfortable, and in various light colors. Discover the technology of AIRism, UV Protection, Miracle Air and BLOCKTECH in the event and discover your perfect outfit for this season.

Explore the full UNIQLO Spring/Summer 2024 collection at the Main Atrium Mall Senayan City until 21 January 2024. 

Don’t miss out on the exciting programs happening in the event!

#UNIQLO24SS
@uniqloindonesia
